      "description": "<p>Si elegiste la opción LLEGA HOY, como método de envío, te recordamos que las entregas son en el DÍA, con un rango de horario hasta las 19.</p><br><p>Realizamos FACTURA A - REQUISITO INDISPENSABLE: El comprador debe tener sus datos correctamente cargados en su configuración para realizar la factura correspondiente de forma automática.</p><br><br><br><p>Xiaomi Redmi Note 10 5G 4GB/128GB Garantia Tienda Oficial</p><br><p>Características</p><br><p>Marca: Xiaomi</p><p>Modelo: Redmi Note 10 5G</p><p>Memoria interna: 128 GB</p><p>Memoria RAM: 4 GB</p><p>Dual SIM: Si</p><p>Compañía telefónica: Liberado</p><p>Sistema operativo: Android</p><p>Tamaño de la pantalla: 6.5 \"\"</p><p>Resolución de la cámara: 48 Mpx/2 Mpx/2 Mpx</p><p>Resolución de la cámara frontal: 13 Mpx</p><p>Red: 5G</p><p>Con pantalla táctil: SI</p><p>Cámara digital: SI</p><p>Tipos de tarjeta de memoria: MICRO SD</p><p>Capacidad de tarjeta de memoria: 512 GB</p><p>USB: USB-C</p><p>Wi-Fi: SI</p><p>Con GPS: SI</p><p>Radio: SI</p><p>Reproductor de música: SI</p><p>MP3: SI</p><p>Grabador de voz: SI</p><p>Resolución de video: 1920 px x 1080 px</p><p>Sintonizador de TV: NO</p><p>Versión del sistema operativo: 11</p><p>Tamaño de SIM: Nano-SIM</p><p>Resolución de la pantalla: 1080 px x 2400 px</p><p>Procesador: MediaTek MT6853 Dimensity 700</p><p>Núcleos del procesador: 8</p><p>Velocidad del procesador: 2.2 GHz</p><p>Tipo de batería: Polímero de litio</p><p>Capacidad de la batería: 5000 mAh</p><p>Sensor de movimiento: SI</p><p>Brillo: SI</p><p>Resolución de video frontal: 1920 px x 1080 px</p><p>Cámara lenta: SI</p><p>Con Bluetooth: SI</p><p>Mini HDMI: NO</p><p>Zoom óptico: SI</p><p>Zoom digital: SI</p><p>Tipo de pantalla: Dot Display</p><p>Linterna: SI</p><p>Es a prueba de agua: SI</p><p>Giroscopio: SI</p><p>Lector de huella digital: SI</p><p>Sensor de proximidad: SI</p><br><p>Ultra Rápido.</p><p>La conectividad 5G no es rápida, es ultrarrápida. Al conectarse a una red 5G, Redmi Note 10 5G te permite disfrutar de juegos fluidos en tiempo real y video llamadas sin interrupciones, ofreciendo una experiencia de uso mucho más envolvente y fluida para ver series, películas o jugar sin que se trabe y sin pausas. Es compatible con la avanzada tecnología de dual SIM o doble SIM (5G+5G).</p><br><p>Excelente rendimiento.</p><p>Redmi Note 10 5G es tres veces más rápido que sus competidores. El procesador MediaTek Dimensity 700 se creó utilizando un proceso distintivo de 7 nanómetros. Está equipado con un CPU (procesador) de 8 núcleos cuya velocidad de procesamiento es de hasta 2,2 GHz, además de un potente GPU (procesador gráfico) ARM Mali G57, lo que garantiza un funcionamiento fluido del equipo y proporciona una experiencia de usuario impecable y extraordinaria.</p><br><p>Poderoso.</p><p>Vas a estar siempre un paso adelante al cargar juegos, al ver películas y demás, gracias a UFS 2.2. La tecnología de memoria flash UFS 2.2, es una tarjeta de memoria o memoria de almacenamiento que sirve para almacenar todo lo que te imagines (juegos, películas, fotos, archivos) y que cuenta, como agregado, con la función WriteBooster, que es un acelerador de escritura secuencial que mejora en un 100% la velocidad de todo lo que hagas o ejecutes en tu dispositivo y asegura un mejor comportamiento en la experiencia de navegación por internet.</p><br><p>Cómodo.</p><p>Pantalla FHD+ AdaptiveSync de 6,5''. Esta pantalla tiene más cantidad de pixeles que una Pantalla full HD, esto se traduce en imágenes con mayor definición. Además, la frecuencia de actualización de 90 Hz permite que la pantalla muestre 90 fotogramas por segundo, lo que supone un 50 % más de fotogramas que los Smartphones normales con pantallas de 60 Hz, generando un mejor detalle de gráficos en juegos y videos, que disfrutarás como nunca.</p><br><p>Seguro.</p><p>Protección de la vista en todo momento. Como pasamos mucho tiempo utilizando nuestro Smartphone, este modelo cuenta con funciones que garantizan una protección completa de la vista. Independientemente de si estás bajo una luz solar intensa, a contraluz o es de noche, la pantalla se puede ajustar de forma precisa para garantizar una comodidad óptima para la vista. Además, cuenta con Reading Mode 3.0, una experiencia de lectura similar a la del papel.</p><br><p>Batería de alta capacidad (5000 mAh).</p><p>La batería de 5000 mAh tiene suficiente potencia para hacer lo que quieras. Gracias a una capacidad al nivel de una batería externa, podrás disfrutar del entretenimiento audiovisual durante horas. Con un uso normal, la batería puede aguantar fácilmente durante todo el día, por lo que no tendrás que preocuparte por su recarga. Al disponer de carga rápida, podrás cargar tu equipo por completo en menos tiempo.</p><br><p>Cámara triple de 48 MP.</p><p>Captura tu entorno con facilidad. Con una cámara principal de 48 MP, una cámara macro que captura los detalles y un sensor de profundidad con el que puedes inmortalizar retratos cautivadores, tus fotos serán impresionantes y con la mejor calidad, independientemente de lo que fotografíes.</p><br><p>Ligero y elegante, amor a primera vista.</p><p>Parte posterior curva 3D para mejorar el agarre y disfrutar de la máxima comodidad. El suave detalle de los colores naturales acentúa una sencillez de alta calidad.</p><br>",
