      "description": "<p>Pensado para vos</p><p>El Samsung XCover Pro posee el novedoso sistema operativo Android 10 que incorpora respuestas inteligentes y acciones sugeridas para todas tus aplicaciones. Entre sus diversas funcionalidades encontrarás el tema oscuro, navegación por gestos y modo sin distracciones, para que completes tus tareas mientras disfrutás al máximo tu dispositivo.</p><br><p>Doble cámara y más detalles</p><p>Sus 2 cámaras traseras de 25 Mpx/8 Mpx te permitirán tomar imágenes con más detalles y lograr efectos únicos como el famoso modo retrato de poca profundidad de campo.</p><br><p>Además, el dispositivo cuenta con cámara frontal de 13 Mpx para que puedas sacarte divertidas selfies o hacer videollamadas.</p><br><p>Más para ver</p><p>Con su pantalla TFT de 6.3 \", disfrutá de colores intensos y mayor nitidez en todos tus contenidos.</p><br><p>Desbloqueo facial y dactilar</p><p>Máxima seguridad para que solo vos puedas acceder al equipo. Podrás elegir entre el sensor de huella dactilar para habilitar el teléfono en un toque, o el reconocimiento facial que permite un desbloqueo hasta un 30% más rápido.</p><br><p>Batería de duración superior</p><p>¡Desenchufate! Con la súper batería de 4050 mAh tendrás energía por mucho más tiempo para jugar, ver series o trabajar sin necesidad de realizar recargas.</p><br><p>Gran capacidad de almacenamiento</p><p>Con su memoria interna de 64 GB siempre tendrás espacio para almacenar archivos y documentos importantes. Además, podrás guardar películas, series y videos para reproducirlos cuando quieras sin conexión.</p><br><p>PREGUNTAS FRECUENTES</p><br><p>¿Los productos son nuevos y originales?</p><p>Sí. Nuestros productos son todos nuevos y originales</p><br><p>¿Cuánto demora la entrega del producto?</p><p>Para conocer cuanto demora tu entrega podes usar el calculador de envios en la publicacion del producto</p><br><p>¿Cómo pago el envío?</p><p>A través de MercadoPago, debes pagarlo al mismo tiempo que pagas el producto. Tené en cuenta que si utilizas Pago Fácil, Rapipago o Provincia Pagos, el pago puede demorarse de 1 a 3 días en acreditarse. En algún caso la ubicación puede tener el envío bonificado.</p><br><p>¿Puedo hacer el seguimiento de mi pedido?</p><p>Desde la sección “Tus compras” en Mercado Libre podrás conocer el estado del envío de tu pedido.</p><br><p>Puedo retirar personalmente el producto?</p><p>Si, podes retirar tus productos personalmente, recorda que cuando ofertas tenes que elegir la opcion \"En el domicilio del vendedor\", si compras con ENVIO no se podra retirar por nuestras sucursales</p><br><p>¿Cuáles son las formas de pago disponibles?</p><p>Podés pagar con todas las tarjetas de crédito, Pago Fácil, Rapipago o Banelco a través de MercadoPago. Tu dinero está 100% protegido.</p><br><p>¿Hacen Factura A ?</p><p>Si hacemos Factura A.</p><p>En caso de solicitar Factura A vamos a necesitar nro de CUIT e IIBB. Como somos agentes de percepcion de Ingresos Brutos en CABA, necesitamos tambien nos envies la constancia de inscripcion para verificar si corresponder realizar la misma, en el caso de surgir alguna diferencia por percepcion de IIBB te sera enviado el link de pago para abonar la diferencia. Tenes 48 horas para mandar dichos datos, cumplido dicho plazo se emitira una Factura B consumidor Final.</p><br><p>ENVIOS</p><p>Los envios se realizan con normalidad por Correo Argentino o el Correo que sea necesario, tene en cuenta la medida y el peso de los paquetes, En el caso de solicitar un pago extra se enviara link de pago y se vera reflejado en la Factura correspondiente.</p><br><p>TU CONSUTA NO MOLESTA</p><br>",
