      "description": "<p>SAMSUNG GALAXY M12 NEGRO 4/128GB 6.5\"</p><p>Más pantalla significa más espacio para jugar</p><p>Ampliá tu vista con la pantalla Infinity-V de 6.5 pulgadas del Galaxy M12 y mirá lo que te estabas perdiendo. Con la tecnología HD +, tu contenido diario se ve nítido y claro.</p><br><br><br><p>Se ve tan bien como se siente</p><p>Poné en tus manos el elegante estilo del Galaxy M12. Un acabado metálico y un micro patrón ofrecen un diseño contemporáneo, mientras que las curvas suaves ofrecen un agarre cómodo, haciendo que se sienta tan bien como se ve. Elegí entre los colores clásicos Negro o Verde</p><br><br><br><p>Descubrí más creatividad para capturar contenido con la cámara cuádruple</p><p>Capturá momentos memorables con detalles nítidos con la cámara principal de 48 MP. Ampliá el ángulo de visión con la cámara ultra ancha. Personalizá el enfoque con la cámara de profundidad o acercate a los detalles con la cámara macro.</p><br><br><br><p>Cámara ultraancha, experiencias ultraanchas</p><p>Similar a la vista del ojo humano, la cámara ultra gran angular de 5MP ve el mundo con un ángulo de visión de 123 grados, lo que agrega más perspectiva a todo lo que captura.</p><br><br><br><p>La cámara macro presta atención a los pequeños detalles</p><p>Acercate con la cámara macro de 2MP y resaltá los detalles ultrafinos en tu imagen. Aplicá un efecto Bokeh natural a tus imágenes, lo que permite que el sujeto se destaque del fondo.</p><br><br><br><p>Llevá el enfoque al frente con la cámara de profundidad</p><p>La cámara de profundidad de 2MP te permite ajustar la profundidad de campo en tus fotos. Con un simple toque, podés ajustar fácilmente el desenfoque del fondo detrás del sujeto para obtener tomas de retratos de alta calidad que realmente se destacan.</p><br><br><br><p>Cámara frontal, selfies elegantes</p><p>Con la cámara frontal Galaxy M12 de 8 megapíxeles y el efecto bokeh, es fácil tomar selfies impresionantes que te muestren más a vos y menos fondo.</p><br><br><br><p>Energía que te mantiene en marcha</p><p>Anticipate al día con una batería que no te ralentizará. La batería de 5.000 mAh (típica) te permite seguir haciendo lo que haces durante horas y horas. Y con hasta 15 W de carga rápida adaptable, el Galaxy M12 vuelve rápidamente a su máxima potencia.</p><br><br><br><p>Un rendimiento sólido en el que podés confiar</p><p>Galaxy M12 combina la potencia de procesamiento de ocho núcleos con hasta 4 GB de RAM para un rendimiento rápido y eficiente. Disfrutá de 128 GB de almacenamiento interno o expandilo aún más con una tarjeta microSD de hasta 1 TB.</p><br><br><br><p>Hecho para enfocarse con One UI</p><p>One UI te ayuda a concentrarte en lo que te importa. El hardware y el software funcionan juntos, con contenido y funciones al alcance de tu mano para que puedas acceder a ellos más rápido. Usá el modo oscuro para una experiencia cómoda en la oscuridad, y con imágenes claras e intuitivas, usar tu smartphone es como una segunda naturaleza.</p><br><br><br><p>Seguridad de grado de defensa. Protegé lo que te importa.</p><p>Integrado en el hardware y software del teléfono desde el principio, Samsung Knox protege tu teléfono desde el momento en que se enciende. Al ofrecer seguridad de varias capas, defiende tu información más confidencial del malware y las amenazas maliciosas.</p><br><br><br><p>Una experiencia increíble de Android ™, siempre</p><p>Obtené las últimas aplicaciones de Google en el sistema operativo Android, totalmente compatible con tu Galaxy M12.</p><br><br><br><p>Mantené tu dispositivo en óptimas condiciones con nosotros</p><p>Disfrutá de la tranquilidad cuando elijas comprar un teléfono inteligente Galaxy. El diagnóstico interactivo y la optimización en la aplicación Samsung Members facilitan el ajuste del rendimiento de sus dispositivos, mientras que nuestra línea de ayuda te permite solucionar problemas cuando necesités ayuda adicional.</p><br><p>-------------------------------------------------------------------------------</p><p>Horario de Atención al Cliente: Lunes a Viernes de 8 a 20 hs. Sábado de 9 a 13</p><br><p>PREGUNTAS FRECUENTES:</p><p>-RETIRO DE LA COMPRA: Si elegís una de nuestras sucursales o los puntos de Retiro de Capital Federal o Rosario, te informaremos día de retiro, tener en cuenta que puede demorar dependiendo de la sucursal hasta 7 días.</p><p>-ATENCIÓN TELEFÓNICA y por CHAT: Nuestro equipo de atención podrá atenderte de Lunes a Viernes de 9 a 20 hs. También podés contactarnos por el servicio de mensajería interno de Mercadolibre.</p><br><p>-ENVÍO: Hacemos envíos a todo el país. Dependiendo el producto y la zona, enviamos por Correo Privado o por Transporte Propio. Además muchos de nuestros productos cuentan con MERCADOENVÍOS. En todos los casos, después de comprar vas a recibir un e-mail con el código de seguimiento de tu pedido para que puedas ir verificándolo mientras te llega.</p><br><p>-FACTURA: Realizamos factura A o B. Las facturas B son a nombre de la persona que realiza la compra.</p><br><p>-MEDIOS DE PAGO: Podes abonar por MERCADO PAGO. https://www.mercadopago.com.ar/cuotas</p><br><p>-POSTVENTA: Ante cualquier consulta nuestro equipo de atención al cliente está disponible para resolver tu inquietud. Escribanos por CHAT de Mercado Libre y le resolveremos cualquier inconveniente.</p><br><p>Acerca de Nosotros:</p><p>Somos una compañía con más de 60 años en la industria de Retail que apuesta al crecimiento desde valores como la eficiencia, la calidad de atención y el servicio.</p><p>Contamos con 60 sucursales distribuidos en todo el país, y con puntos de retiros estratégicos. Estamos en constantes proyectos de expansión para reforzar el compromiso con cada uno de nuestros clientes.</p><p>NALDO LOMBARDI.</p><br>",
